  onSubmitForReview(): void {
    var ValidationErrors = [];
    console.log(this.AllRequireData);
    console.log(this.DocumentsList);

    this.AllRequireData.forEach((item) => {
      const isDocumentMatched = this.DocumentsList.filter((itemOne) => {
        // console.log(itemOne.auditDocumentTypeId)
        // console.log(item.visitLevelId)
        // console.log(itemOne.visitLevelId)
        // console.log(typeof item.documentTypeId)
        // console.log(typeof itemOne.auditDocumentTypeId)
        // console.log(typeof item.visitLevelId)
        // console.log(typeof itemOne.visitLevelId)
        return (
          item.documentTypeId === itemOne.auditDocumentTypeId &&
          item.visitLevelId === itemOne.visitLevelId
        );
      });
      console.log(isDocumentMatched);
      if (isDocumentMatched.length == 0) {
        // alert('' + ` ${item.documentName}`);
        ValidationErrors.push(item.documentName + "  Document is required");
      }
    });

    if (ValidationErrors.length > 0) {
      const numberedErrors = ValidationErrors.map(
        (error, index) => `${index + 1}. ${error}`
      );
      const errorMessage = numberedErrors.join("\n");
      alert("Validation Errors:" + "\n" + errorMessage);
      return;
    }

    let minor = parseFloat(this.AuditReportForm.get("Minor").value);
    let major = parseFloat(this.AuditReportForm.get("Major").value);
    let critical = parseFloat(this.AuditReportForm.get("Critical").value);
    let timeBound = parseFloat(this.AuditReportForm.get("TimeBound").value);
    let observation = parseFloat(this.AuditReportForm.get("Observation").value);
    if (Number.isNaN(minor)) {
      abp.message.error("Minor can be not empty, value should be a number !");
      return;
    }
    if (Number.isNaN(major)) {
      abp.message.error("Major  can be not empty, value should be a number!");
      return;
    }
    if (Number.isNaN(critical)) {
      abp.message.error("Critical can be not empty, value should be a number!");
      return;
    }
    if (Number.isNaN(timeBound)) {
      abp.message.error(
        "TimeBound  can be not empty, value should be a number!"
      );
      return;
    }
    if (Number.isNaN(observation)) {
      abp.message.error(
        "Observation can be not empty, value should be a number!"
      );
      return;
    }

    abp.message.confirm(
      "Please make sure all the required information is entered. Are you sure to submit your application for review?",
      undefined,
      (result: boolean) => {
        if (result) {
          // this.SecUserService.Deleteuser(e.row.data.id).subscribe()
          //     abp.message.info("Deleted successfully", "Status", {});
          const UserModel = {
            reportMasterid: this.ReportMasterid,
            userId: parseInt(localStorage.getItem("userId")),
          };
          this.AuditReportService.SubmitForReview(UserModel).subscribe(
            (Response) => {
              if (Response.message == "1") {
                abp.message.info("Successfully Reports Send For QC !");
                window.location.reload();
              } else {
                abp.message.error("Not Submited!");
              }
              this.reloadGrid();
              this.onSearch();
            }
          );
        }
      }
    );
  }

