  AuditComplete(): void {
    abp.message.confirm(
      "Please make sure all the required information is got. Are you sure to  your Audit Completed",
      undefined,
      (result: boolean) => {
        if (result) {
          this.VisitModel.OrganizationId = parseInt(
            localStorage.getItem("organizationId")
          );
          this.VisitModel.StandardId = this.standardId;
          this.VisitModel.Id = this.AuditVisitId;
          this.VisitModel.CreatedById = parseInt(
            localStorage.getItem("userId")
          );

          this.AuditReportService.AuditComplete(this.VisitModel).subscribe(
            (Response) => {
              //abp.message.info(Response.message)
              //this.router.navigateByUrl('/app/pages/sales/audit-plan-list?');
              if (Response.message == "1") {
                abp.message.info("Successfully Completed!");
                this.router.navigateByUrl("/app/pages/sales/audit-plan-list?");
              } else if (Response.message == "2") {
                abp.message.info(
                  "Project amount not set in Project Amount form for this Standard!"
                );
              } else if (Response.message == "0") {
                abp.message.error("Audit Not Exists!");
              }
            }
          );
        }
      }
    );
  }

