  DownloadManagerfile(e): void {
    debugger;

    //this.id=e.row.data.id;
    // var fillename=e.row.data.title;
    var fillename = e.row.data.documentPath;
    this.AuditReportService.DownloadManagerfile(
      parseInt(e.row.data.id)
    ).subscribe((result: Blob) => {
      const Blb = new Blob([result], { type: result.type });
      // const url=window.URL.createObjectURL(Blb);

      // window.open(url);
      // console.log("success");

      const a = document.createElement("a");
      a.setAttribute("style", "display:none;");
      document.body.appendChild(a);
      a.download = fillename;
      // const fileName =

      //="farooq";
      a.href = URL.createObjectURL(Blb);
      a.target = "_blank";
      a.click();
      document.body.removeChild(a);
    });
  }

